const myImage = new Image();
myImage.src =
  "data:image/jpeg;base64,"
// IMAGEM 1

// para a imagem n√£o quebrar, dependendo do provedor ou davelocidade da interne passa a imagem, como string, atrav√©s da base64, e dentro da fun√ß√£o load(), para carregar a imagem

myImage.addEventListener("load", function () {
  // a const canvas √© para pegar o elemento canvas
  const canvas = document.getElementById("canvas1");
  // a const ctx √© para ter os m√©todos de desenho do canvas dispon√≠veis
  const ctx = canvas.getContext("2d");
  canvas.width = 300;
  canvas.height = 506;

  // Para desenhar no canvas, passa se o draw
  // H√° 3 formas formas,
  //   // ser√° uado aqui a  que espera 5 argumentos
  //   // o primeiro:
  //   //                1. A imagem que quero
  //   //                2. e 3. O n√∫menro 0 (zero) √© passado duas vezes, √© para aparecer no canto superior esquerdo e cobrir toda a area do canvas
  //   //                4. e 5.  canvas.width, canvas.height
  // const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);

  //   // faz com que  imagem desapare√ßa
  //  ctx.clearRect(0, 0, canvas.width, canvas.height);
  // essa let ser√° para usada depois para receber as particulas da imagem
  ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
  const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);

  //   // faz com que  imagem desapare√ßa
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  let particlesArray = [];
  // essa const numberOfParticles, √© usada para definir a quantidade particulas que caem em cima da imagem
  const numberOfParticles = 8000;

  //
  // as particulas devem cair sobre a imagem, em diferentes velocidades, como se fosse areia cando dore uma imagem de auto relevo.
  // par isso cria-precisa-se MAPEAR a imagem,
  // para que cada particula caia de acordo com intensidade do brilho de cada pixel da imagem
  // cria-se um array fazio, o objetivo √© manter ARMAZENAR O VALOR DE CADA PIXEL DA IMAGEM
  // cada pixel tem um valor, esse valor de cada pixel receber√° uma velocidade,
  //

  // ctx.drawImage(myImage, 0,0, canvas.width, canvas.heigth)

  //
  // cria-se um vari√°vel que pega as inform√ß√µes de pixel da imagem,
  // e retorna um objeto semelhante a uma matriz
  // cada pixel reccebe um valor individualmente
  // um valor para:
  //                             RED:
  //                             GREEN:
  //                             BLUE:
  //                             ALPHA:
  // por isso faz-se a vari√°vel que percorre a tela inteira
  // isso pode ser verificado pelo console.log()
  // essa constante pixels retorna uma matrix chamada: "dados"
  // e contem os atributos da area digitalizada da imagem
  // tamb√©m contem um array chamado: "Uint8ClampedArray"
  // que contem apenas n√∫meros inteiros, de 0 - 255
  // (1.412.000)
  // (600.000)
  // (600.000)
  // [9.999]
  // (10.000)

  // erro
  // const pixels = ctx.getImageData(0,0, canvas.width, canvas.height)
  // c(pixels)

  let mappedImage = [];

  for (let y = 0; y < canvas.height; y += 1) {
    let row = [];
    for (let x = 0; x < canvas.width; x += 1) {
      const red = pixels.data[y * 4 * pixels.width + x * 4];
      const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
      const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];
      const brightness = calculateRelativeBrightness(red, green, blue);
      const cell = [(cellBrightness = brightness)];
      row.push(cell);
    }
    mappedImage.push(row);
  }
  // c(mappedImage)

  function calculateRelativeBrightness(red, green, blue) {
    return (
      Math.sqrt(
        red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
      ) / 100
    );
  }

  // √© criado uma classe particulas,
  // ela ser√° usada para criar as 5000 particulas iguais
  // essas 5000 mil particulas ser√£o adicionadas ao Arraty vazio, criado anteriormente:
  //                            let particlesArray = [];
  // o constructor() da classe Particulas receber√° cada aprticula individualmente
  // O x receber√° um n√∫mero alet√≥rio entre 0 e a LARGURA da tela
  // para as particulas se espalharem, √© definido o inicio da coordenada horizontal em 0.
  //para a velocidade, √© definido inicialmente em 0
  // a velocidade de queda er√° um n√∫mento aleat√≥rio entre 0  e 3.5
  // a velocidade de queda tamb√©m depende do brilho da imagem
  // quanto MENOS brilho, mais rapido a queda
  // quanto MAIS brilho, mais rapido a queda
  // this.velocity, o random() √© multiplicado por 0.5, isso √© apenas para dar mais aleatoriedade
  // o tamanho tamb√©m ter√° uma aleatoriedade entre 1 e 2.5
  class Particles {
    constructor() {
      this.x = Math.random() * canvas.width;
      this.y = 0;
      this.speed = 0;
      this.velocity = Math.random() * 3.5;
      this.size = Math.random() * 1.5 + 1;
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
    }

    // aqui ser√° criado um m√©todo para atuzaliza√ß√£o das particulas, quadro a quadro, o: this.y += this.velocity.
    // esse this.y+= velocity far√° com que ap√≥s as particulas chegarem no final retornam para o inicio da imagem e caem novamente, ams agora o this.y, rceve a velocity e caem de forma diferente da anterior

    // quando as particulas chegarem no final do canvas, elas receber√£o um if(), redefinindo elas para o in√≠cio da tela em 0,
    // e cair√£o novamente de forma aleat√≥ria

    //
    update() {
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
      this.speed = mappedImage[this.position1][this.position2][0];
      let movement = 2.5 - this.speed + this.velocity;

      this.y += movement;
      if (this.y >= canvas.height) {
        this.y = 0;
        this.x = Math.random() * canvas.width;
      }
    }

    // o metodo draw faz um circulo, e desenha cada particula,

    // o m√©todo draw de desnho, desenhar√°  de desenho espec√≠fico, ou seja, AQUI ELE FAR√Å um circulo representando APENAS UMA PARTICULA.
    // come√ßara com um estilo em branco
    // o ctx arc() para desenhar um arco de particulas sobre  imagem, ddando o aspecto de terra caindo sobre a imagem em auto relevo, passa os par√¢metros tamanho de x √† y, angulo inicil e angulo final da imagem
    // o fill() √© chamado aqui para preenchera o circulo da partucla
    draw() {
      ctx.beginPath();
      ctx.fillStyle = "white";
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      ctx.fill();
      // //
    }
  }
  // a function init() √© reponsavel para iniciar um loop qua ficar√° acontecendo e passando o total de particulas passadas anterioremnte ou seja, 5000.
  // cada vez que o loop aconetce o Array vazio √© chamado:
  //                                                        let particlesArray = [];
  // CADA VEZ QUE O FOR ACONTECE ELE PEGA AS UMA DAS 5000 PARTICULAS E COLOCA NO ARRAY FAZIO,
  // E CHAMA A CLASS PARTICULA() (NEW PARTICULAS()), E ESSA CLASSE TEM TODO O MAQUIN√ÅRIO:
  //                  - O TAMNAHO
  //                  - VELOCIDADE
  //                  - AS FUN√á√ïES RANDOMS()
  //                  - O METODO UPDATE()
  //                  - O M√âTODO DRAW()
  // QUE CONTRUIR√Å UMA NOVA PARTICULA
  // NO PRIMENRO LOOP TEREMOS APENAS UMA PARTICULA, ISSO ACONTECER√Å AS 5000 VEZES AT√â PREENCHE TODO O ARRAY COM AS 5000 PARTICULAS PASSADAS, CRIANDO OBEJETOS (PARTICULAS EM BRANCO), DENTRO DESSE ARRAY.
  // esse for apenas cricou e colocou as particulas dentro desse array
  function init() {
    for (let i = 0; i < numberOfParticles; i += 1) {
      particlesArray.push(new Particles());
    }
  }

  init();
  // para animar as particulas,
  // √© criado um loop de anima√ß√£o
  // cria-se um retangulo preto semi transparente, o ctx.globalAlpha = 0.05;
  // isso far√° um aspecto de desaparecimento da imagem gradul,
  // que acontecer√° de forma gradual de acordo com o valor passado dentro do valore recebido pelo Alpha
  // quanto MAIOR o n√∫meros de zeros antes do ponto, mais CLARO E LENTO vai ficando a imagem
  // quanto MENOR o n√∫meros de zeros antes do ponto, OU SEJA, N√öMENROS INTEIROS, mais ESCURO E mais R√ÅPIDO vai ficando a imagem
  // ap√≥s a imagem esvaecer, √© criado um quadro preto pelo ctx.fillStyle(), esse fillstyle() passa apenas a cor
  // o fillRect() desenha o quadro com as dimens√µes necess√°rias, ou seja, em cima do canvas criado no come√ßo do trabalho
  // Esse for percorre todo  arrray criado com as particulas, no for anterior que apenas criava as particulas.
  // depois de percorrer todo o for ele recalcula cada posi√ß√£o desse objeto particulas, e anima essas particulas dentro do canvas, dando o aspecto de queda.

  // mas s√≥ isso n√£o fasz anima√ß√£o, tem que chamar o
  // requestAnimationFrame(animate) e passar a fun√ß√£o dentro dela
  function animate() {
    // o ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    // foi tirado de onde estava e colocado aqui temporariamete para podermos ver a imagem original, onde ela estava, em cima do :  let particlesArray = []; a imagem desaparecia ap√≥s algus segundos
    // ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.03;
    ctx.fillStyle = "rgb(0, 0, 0)";
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.03;
    for (let i = 0; i < particlesArray.length; i += 1) {
      particlesArray[i].update();
      ctx.globalAlpha = particlesArray[1].speed * 0.03;
      particlesArray[i].draw();
    }
    //  o m√©tod requestAnimationFrame(animate) √© mais sutil na transi√ß√£o dos frames da anima√ß√£o, que o for, ou randon()
    // o metodo requestAnimationFrame(), cria uma recurs√£o repetidamente, e repetidamente
    requestAnimationFrame(animate);
  }
  animate();
});

